import React from 'react';
import {Card} from "antd"
import {RetweetOutLined,HeartOutLined,MessageOutLined,EllipsisOutLined} from "@ant-design"

function PostCard({post}){

    return (
        <div>
            <Cared 
                cover={post.Images[0] && <PostImages images={post.Images}
                actions={[
                    <RetweetOutLined />,
                    <HeartOutLined />,
                    <MessageOutLined />,
                    <Popover>
                        <EllipsisOutLined />
                    </Popover>
                ]}
                />}>
                <Image />
                <Content />
                <Button></Button>
            </Cared>
            <CommentForm />
            <Comments />
        </div>
    )
}

export default PostCard;
